from collections import deque


class Solution:
    def shortestDistance(self, maze: [[int]], start: [int], destination: [int]) -> int:

        # check if destination is somewhere ball could halt
        candidates = [(0, 1), (0, -1), (1, 0), (-1, 0)]

        # check = []

        def isValid(i, j):
            if i >= 0 and j >= 0 and i < len(maze) and j < len(maze[0]) and maze[i][j] == 0:
                return True

        visited = set()
        visited.add(tuple(start))
        tup = start + [0]
        queue = deque([tup])
        temp = deque()
        count = 0
        l = []
        while queue:
            i, j, dist = queue.popleft()
            print(i, j, dist)

            if [i, j] == destination:
                l.append(dist)

            for k, v in candidates:
                x, y, t = i, j, dist
                while isValid(x + k, v + y):
                    x = x + k
                    y = y + v
                    t += 1

                if (x, y) not in visited:
                    visited.add((x, y))
                    temp.append((x, y, t))
            if not queue:
                temp, queue = queue, temp
                count += 1

        print(l)

